using Symbolics 
@variables xa[1:3] qa[1:4] xb[1:3] qb[1:4] v[1:3] λ[1:3] 

function Gtλ_tra_a(xa, qa, xb, qb, v, λ)
    qa = UnitQuaternion(qa..., false)
    qb = UnitQuaternion(qb..., false) 

    p = xb + vrotate(v, qb)

    X = -VLᵀmat(qa) * RVᵀmat(qa)
    Q = 2 * VLᵀmat(qa) * (Lmat(UnitQuaternion(p)) - Lmat(UnitQuaternion(xa))) * LVᵀmat(qa)

    return [transpose(X); transpose(Q)] * λ
end

function Gtλ_tra_b(xa, qa, xb, qb, v, λ)
    qa = UnitQuaternion(qa..., false)
    qb = UnitQuaternion(qb..., false) 

    X = VLᵀmat(qa) * RVᵀmat(qa)
    Q = 2 * VLᵀmat(qa) * Rmat(qa) * Rᵀmat(qb) * Rmat(UnitQuaternion(v)) * LVᵀmat(qb)

    return [transpose(X); transpose(Q)] * λ
end

function Gtλ_tra_b(xb, qb, v, λ)
    qb = UnitQuaternion(qb..., false) 

    X = I
    Q = 2 * VRᵀmat(qb) * Rmat(UnitQuaternion(v)) * LVᵀmat(qb)

    return [transpose(X); transpose(Q)] * λ
end

Gtλa = Gtλ_tra_a(xa, qa, xb, qb, v, λ)
jacaa = Symbolics.jacobian(Gtλa, [xa; qa])
jacab = Symbolics.jacobian(Gtλa, [xb; qb])

Gtλb = Gtλ_tra_b(xa, qa, xb, qb, v, λ)
jacba = Symbolics.jacobian(Gtλb, [xa; qa])
jacbb = Symbolics.jacobian(Gtλb, [xb; qb])

Gtλb1 = Gtλ_tra_b(xb, qb, v, λ)
jacbb1 = Symbolics.jacobian(Gtλb1, [xb; qb])

for i = 1:6
    for j = 1:7
        println("dG[$i, $j] = ", jacaa[i, j])
    end
end

